import React from "react";
import CardComp from "../Components/CardComp/CardComp";

export default function Home() {
  const filmProfiles = [
    {
      name: "Avatar: The Way of Water",
      isShowing: true, // Phim đang chiếu
      displayType: "3D", // Định dạng: 2D hoặc 3D
      img: "https://example.com/avatar-poster.jpg" // URL ảnh poster phim
    },
    {
      name: "Spider-Man: No Way Home",
      isShowing: false, // Phim đã ngừng chiếu
      displayType: "2D", // Định dạng: 2D
      img: "https://example.com/spiderman-poster.jpg"
    },
    {
      name: "The Batman",
      isShowing: true,
      displayType: "IMAX", // Định dạng: IMAX
      img: "https://example.com/batman-poster.jpg"
    }
  ];

  return (
    <div className="flex container mx-auto flex-row *:basis-1/2 sm:*:basis-1/3 lg:*:basis-1/6  mx-4 bg-white flex-wrap  *:shrink-0  *:p-1 justify-center ">
      {filmProfiles
        .filter((film) => film.isShowing) // Lọc chỉ phim đang chiếu
        .map((filmProfile) => (
          <CardComp key={filmProfile.name} {...filmProfile} />
        ))}
    </div>
  );
}



